import React from 'react';
import Hero from '../components/Hero';
import DisasterGrid from '../components/DisasterGrid';
import EmergencyHelpline from '../components/EmergencyHelpline';
import AskAI from '../components/AskAI';
import MedicalGuide from '../components/MedicalGuide';
import ExperienceShare from '../components/ExperienceShare';
import '../styles/Home.css';

function Home() {
  return (
    <main>
      <Hero />
      <DisasterGrid />
      <EmergencyHelpline />
      <AskAI />
      <MedicalGuide />
      <ExperienceShare />
    </main>
  );
}

export default Home;
